import React from "react";
import Form from "react-bootstrap/Form";
import { Controller } from "react-hook-form";

const ImageUpload = React.forwardRef((ref) => (
  <Controller
   as="file">
    <Form.Label>Image Upload</Form.Label>
    <Form.File></Form.File>
  </Controller>
));

export default ImageUpload;
